import React,{Component} from "react";

class Navigation extends Component{

    render(){
        return(
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <div className="container">
                    <a className="navbar-brand" href="#">Git Engine</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                    <div className="navbar-nav ms-auto">
                        <a className="nav-link active" aria-current="page" href="#">Home</a>
                        <a className="nav-link active" aria-current="page" href="#">All Users</a>
                        <a className="nav-link active" aria-current="page" href="#">Search</a>
                        <button className="nav-link active btn btn-primary" id="search-btn" aria-current="page">Search</button>
                    </div>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navigation
